export default async (req, res) => {
    res.statusCode = 200
    const { count } = JSON.parse(req.body);
    try {
        const data = { res: `Server response count is ${count}` }
        console.log("--------->", data)
        res.json(data);

    } catch (e) {
        console.log("Whoooooop Server error")
        res.status(e.status).json(e);
    }


}
